criteria.textblock:
        Inclusion Criteria:

          -  Male or female adults, age 18 through 65 years of age at time of screening;

          -  Weight ≤ 100 kg and body mass index ≤ 35;

          -  Written informed consent obtained from the patient prior to receipt of any study
             medication or beginning study procedures;

          -  Previously documented diagnosis of asthma based on episodic symptoms of airflow
             obstruction such as wheezing or chest tightness, with alternative diagnoses (e.g.,
             chronic obstructive pulmonary disease) ruled out;

          -  Currently receiving treatment with short-acting β2 agonists, ICS at doses ≤ 264 μg/day
             fluticasone or equivalent, or both (National Heart, Lung, and Blood Institute [NHLBI],
             2002);

          -  FEV1 or peak expiratory flow (PEF) ≥ 80% of predictable value;

          -  Have had a diagnosis of mild persistent asthma, defined as having asthma symptoms with
             a frequency of more than twice a week but less than once daily, or nighttime symptoms
             with a frequency of more than twice a month but less than once a week (NHLBI, 2002);

          -  Have AHR based on documented clinical history of either methacholine inhalation
             challenge with PC20 ≤ 16 mg/mL or partial reversibility of ≤ 12% in FEV1 within the
             past 18 months (including screening);

          -  Able to provide spirometry readings that meet American Thoracic Society/European
             Respiratory Society standards (Miller, 2005);

          -  Sexually active females, unless surgically sterile or at least 1 year post-menopausal,
             must use an effective method of avoiding pregnancy (including oral, implanted, or
             transdermal contraceptives, intrauterine device, female condom, diaphragm with
             spermicide, cervical cap, abstinence, use of a condom by the sexual partner or sterile
             sexual partner) for 21 days prior to the first dose of study drug, and must agree to
             continue using such precautions through Study Day 150. Cessation of birth control
             after this point should be discussed with a responsible physician. Sexually active
             males, unless surgically sterile, must likewise use an effective method of birth
             control (condom) and must agree to continue using such precautions through Study Day
             150;

          -  Ability to complete the study period, including follow-up period, of up to 150 days;
             and

          -  Willing to forego other forms of experimental treatment and study procedures during
             the study.

        Exclusion Criteria:

          -  Receipt of MEDI-528 in any previous clinical study or prior randomization into the
             trial;

          -  History of allergy or reaction to any component of the MEDI-528 formulation;

          -  Lung disease other than persistent asthma (e.g. chronic bronchitis);

          -  FEV1 < 80% of predicted values;

          -  History of severe asthma or asthma exacerbation requiring intubation;

          -  Use of systemic immunosuppressive drugs including systemic corticosteroids or ICS with
             doses > 264 μg/day fluticasone or equivalent within 4 weeks prior to Study Day 0;

          -  Use of long-acting β2 agonists, theophylline, cromolyn sodium, nedocromil sodium,
             leukotriene receptor antagonists, or any other inhaled or systemic medication for
             asthma (except short-acting β2 agonists or ICS at doses ≤ 264 μg/day fluticasone or
             equivalent) within the 2 weeks prior to Study Day 0;

          -  Current use of any β-adrenergic antagonist (e.g., propranolol);

          -  Any disease or illness, other than asthma, that may require the use of systemic
             corticosteroids during the study period;

          -  Acute illnesses or evidence of significant active infection, such as fever ≥ 38.0°C
             (100.5°F) at screening and up through time of the first dose of study drug;

          -  Current allergy vaccination therapy (desensitization immunotherapy), with less than 3
             months of stable maintenance doses prior to screening;

          -  Receipt of any investigational drug therapy within 30 days or any biologic(s) within 5
             half-lives of the agent prior to the first dose of study drug through Study Day 150;

          -  Receipt of any therapy with a leukocyte-depleting agent unless recovery in white cell
             count has been documented before screening;

          -  Pregnancy (sexually active females must have a negative serum pregnancy test at
             screening and a negative urine pregnancy test prior to study drug administration on
             Study Day 0);

          -  Lactating or breastfeeding woman;

          -  Evidence of infection with hepatitis B or C virus, or human immunodeficiency virus-1
             or -2 (HIV-1 or HIV-2), or active infection with hepatitis A;

          -  History of significant systemic disease (e.g., cancer, infection, hematological,
             renal, hepatic, coronary artery disease or other cardiovascular disease,
             endocrinologic, neurologic, rheumatologic, or gastrointestinal disease);

          -  History of cancer other than non-melanoma skin cancer or cervical carcinoma-in-situ
             treated with apparent success with curative therapy (remission for ≥ 1 year prior to
             screening);

          -  History of primary immunodeficiency;

          -  History of pancreatitis;

          -  History of use of tobacco products of more than one cigarette per month or equivalent
             within 1 year prior to randomization or history of smoking of ≥ 10 pack-years;

          -  Elective surgery planned during the study period through Study Day 150;

          -  Clinically significant abnormalities on physical examination (other than asthma) prior
             to the first dose of study drug (including but not limited to splenomegaly);
             Clinically significant abnormality, as determined by the investigator, on 12-lead ECG,
             MRI, or chest radiograph at the time of screening;

          -  At the time of screening, any abnormality of the following measurements: hemoglobin,
             total white blood cell count (WBC), platelet count, aspartate transaminase (AST),
             alanine transaminase (ALT), amylase, or serum creatinine above the upper limits of
             normal (ULN); or other abnormal laboratory values in the screening panel that, in the
             opinion of the principal investigator, are judged to be clinically significant;

          -  Evidence of any systemic disease or respiratory disease (other than asthma), any
             finding upon physical examination or history of any disease that, in the opinion of
             the investigator or medical monitor, may compromise the safety of the patient in the
             study or confound the analysis of the study; or

          -  Employees of the clinical study site or any other individuals involved with the
             conduct of the study, or family members of such individuals.
